    false,nt"url": null,nt"notes": "This annual narrative report for Tinicum
    National Environmental Center outlines Refuge accomplishments during the 1982 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    the master plan, management planning, compliance with environmental and cultural
    resource mandates, and research and investigations. Refuge administration is outlined;
    information about personnel, youth programs, manpower programs, volunteer programs,
    funding, and safety is given. Habitat management is also covered; subjects include
    wetlands, forests, grasslands, and fire management. The wildlife section of the
    report discusses wildlife diversity, endangered and threatened species, waterfowl,
    marsh birds and waterbirds, shorebirds, raptors, game mammals, fisheries resources,
    marking and bird banding., and environmental contaminants The public uses of the
    Refuge described in this report include outdoor classrooms, interpretive programs,
    fishing, wildlife observation, and law enforcement. The equipment and facilities
    section of the report provides information about new construction, rehabilitation,
    major maintenance, communication systems, and energy conservation. Cooperative programs
    and items of interest are provided at the end. Refuge brochures are attached.",nt"owner_org":
